import React from 'react';
import AddBookButton from '../../components/AddBookButton/AddBookButton';
import BookISBNSearch from '../../services/callAPI';

const Home = (codeISBN) => {

    const bookISBNSearch = ((codeISBN)=>{
        BookISBNSearch(codeISBN)
    })


    return ( 
        <>
        PageHome
        <AddBookButton bookISBNSearch={bookISBNSearch} />
        </>
     );
}

export default Home;
